  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this Environmental Assessment
  (EA) is to evaluate the feasibility of establishing a hunting program on Lost Trail
  National Wildlife Refuge (Refuge). The Service is required under the National Wildlife
  Refuge System Improvement Act of 1997 (16 USC 668dd) to consider opening refuges
  to the six priority wildlife-dependent recreational uses, of which hunting is one.
  \ Six alternatives are considered in this Environmental Assessment, with hunting
  in designated areas being the preferred alternative.\",\n\t\"license_title\": \"License
